window.bookSummaryJSON = "<p><b>Most love stories are written in the stars. Ours was forged in darkness. A love born from survival.</b></p> <p>One, two, three, four...</p> <p>You want a fight, I'll bring a war.</p> <p>Five, six, seven, eight...</p> <p>I'll even use such pretty bait.</p> <p>Tinker, Tailor, Soldier, why...</p> <p>Did you leave me there to die?</p> <p>But I'm not dead,</p> <p>I survived... somehow.</p> <p>And it's my games that you'll play now.</p> <p>Rich men, poor men, begging men, bleed.</p> <p>A brutal death is what they need.</p> <p>Our lives were theirs; they stole our souls.</p> <p>Now, it's our turn to take control.</p> <p>So, do you dare to join me in my game of whys?</p> <p>Where hidden truths become wicked lies.</p> <p>Will you survive the ultimate test?</p> <p>Which one of you will be the best?</p> <p>They call you The Player, but I'm going to show</p> <p>That those closest to you can be your greatest foe.</p> <p><i>The Taskmaster is ready, are you? </i>The Player <i>is a standalone dark romance set in the Soldiers of Anarchy world by international bestselling author Nikki J Summers. Intended for mature listeners.</i></p>"; 
